window.bookSummaryJSON = "<p><b>Dieter Schwarz had a gun pointing at his forehead.</b> </p> <p>To escape and save the lives of herself and two-year-old Alina Mirabaud, Flicka von Hannover walked into the arms of her ex-husband, who wants only her title and her genes in his family tree. She is whisked away to Monaco and held prisoner while her ex plots how many children she will produce for him and his throne. </p> <p>Dieter must be dead. No one could fight their way out of a warehouse, past dozens of heavily armed Russian mafia criminals. </p> <p>Almost no one. </p> <p>Will Flicka and Dieter ever live...happily ever after?</p>"; 
